class Contact extends Component {
    constructor(props){
        super()
        this.state  = {}
        ;
    }
  render() {
    return (
      <div>
        <h2>Get In Touch</h2>
        <p>Phone: XXXXXXXXXX</p>
        <p>Email: XXXXX@XXXXX</p>
      </div>
    );
  }
}

export default Contact;
